import './account_module.scss';
import PropTypes from 'prop-types'; // Assurez-vous d'installer le package prop-types

// Composant Account pour afficher les informations du compte
function Account({ title, amount, description }) {
    return (
        <section className="account">
            {/* Wrapper pour le contenu du compte */}
            <div className="account-content-wrapper">
                <h3 className="account-title">{title}</h3>
                <p className="account-amount">{amount}</p>
                <p className="account-amount-description">{description}</p>
            </div>

            {/* Wrapper pour le bouton d'action */}
            <div className="account-content-wrapper cta">
                <button className="account-transaction-button">View transactions</button>
            </div>
        </section>
    );
}

// Validation des props pour une meilleure robustesse
Account.propTypes = {
    title: PropTypes.string.isRequired,
    amount: PropTypes.string.isRequired,
    description: PropTypes.string
};

export default Account;
